import unittest
import requests
import json
import base64
import os
from unittest import mock
from unittest.mock import patch, MagicMock
from intel_extension_for_transformers.neural_chat.server.neuralchat_client import TextChatClientExecutor, VoiceChatClientExecutor, FinetuningClientExecutor

sample_audio_base64 = """"""

def base64_to_audio(base64_string, output_file):
    audio_data = base64.b64decode(base64_string)

    with open(output_file, 'wb') as audio_file:
        audio_file.write(audio_data)

