class TestTextChatClientExecutor(unittest.TestCase):
    def setUp(self):
        self.text_chat_executor = TextChatClientExecutor()

    def test_execute_successful(self):
        with patch.object(requests, 'post') as mock_post:
            mock_response = MagicMock()
            mock_response.json.return_value = {'response': 'Test response'}
            mock_response.status_code = 200
            mock_post.return_value = mock_response

            argv = ['--query', 'Tell me about Intel Xeon processors.']
            result = self.text_chat_executor.execute(argv)

            self.assertTrue(result)
            mock_post.assert_called_once()

    def test_execute_failed(self):
        with patch.object(requests, 'post') as mock_post:
            mock_post.side_effect = Exception('Test exception simulation for unit test')

            argv = ['--query', 'Test query']
            result = self.text_chat_executor.execute(argv)

            self.assertFalse(result)

    def test_call(self):
        expected_url = 'http://127.0.0.1:8000/v1/chat/completions'
        expected_request = {
            "prompt": "Test prompt",
            "device": "cpu",
            "temperature": 0.1,
            "top_p": 0.75,
            "top_k": 1,
            "repetition_penalty": 1.1,
            "max_new_tokens": 128,
            "stream": False
        }

        with patch.object(requests, 'post') as mock_post:
            self.text_chat_executor(prompt="Test prompt")
            mock_post.assert_called_once_with(expected_url, json.dumps(expected_request))

class TestVoiceChatClientExecutor(unittest.TestCase):
    def setUp(self):
        self.voice_chat_executor = VoiceChatClientExecutor()
        base64_to_audio(sample_audio_base64, "./sample_audio.wav")
        return super().setUp()

    def tearDown(self) -> None:
        for filename in os.listdir("."):
            if filename.endswith(".wav"):
                os.remove(filename)
        if os.path.exists("./tmp_audio_bytes"):
            os.remove("./tmp_audio_bytes")
        if os.path.exists("./app.log"):
            os.remove("./app.log")
        return super().tearDown()

    def test_execute_successful(self):
        with patch.object(requests, 'post') as mock_post, \
             patch('builtins.open', create=True):
            # Set up a mocked response for the asr_url call
            asr_response = MagicMock()
            asr_response.status_code = 200
            asr_response.text = '{"asr_result": "Test ASR result"}'
            tts_response = MagicMock()
            tts_response.status_code = 200
            tts_response.iter_content.return_value = [
                (b"\n\n"),
                (b"data: b'"),
                (b"\n\ndata: b'"),
                (b"abcd"),
                (b"\n\ndata: [DONE]\n\n")
                ]
            mock_post.side_effect = [asr_response, tts_response]


            argv = ['--audio_input_path', 'sample_audio.wav', '--audio_output_path', 'output.wav']
            result = self.voice_chat_executor.execute(argv)

            self.assertTrue(result)
            expected_calls = [
                mock.call('http://127.0.0.1:8000/v1/talkingbot/asr', files=mock.ANY),
                mock.call('http://127.0.0.1:8000/v1/talkingbot/llm_tts', json=mock.ANY, stream=True)
            ]
            mock_post.assert_has_calls(expected_calls)

    def test_execute_failed(self):
        with patch.object(requests, 'post') as mock_post, \
             patch('builtins.open', create=True):
            mock_post.side_effect = Exception('Test exception simulation for unit test')

            argv = ['--audio_input_path', 'sample_audio.wav', '--audio_output_path', 'output.wav']
            result = self.voice_chat_executor.execute(argv)

            self.assertFalse(result)


